import React from "react"
import {AppBar, Tabs, Toolbar, Typography} from "@mui/material";
import AppRegistrationIcon from '@mui/icons-material/AppRegistration';
const Header = () => {
  return (
    <div>
        <AppBar position="sticky">
            <Toolbar>
                <Typography> 
                <AppRegistrationIcon/> 
                </Typography>
                <Tabs>
                    <tab label='Add item'/>
                    <tab label='About Us'/>
                </Tabs>
            </Toolbar> 
           
        </AppBar>
    </div>
  );
};

export default Header;
